CREATE TABLE `AUDIT_LOG` (
  `AUDIT_LOG_ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `USER_ID` int(10) unsigned NOT NULL,
  `TIMESTAMP` datetime NOT NULL,
  `ACTION` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`AUDIT_LOG_ID`),
  UNIQUE KEY `AUDIT_LOG_ID_UNIQUE` (`AUDIT_LOG_ID`),
  KEY `user_fk_idx` (`USER_ID`),
  CONSTRAINT `user_fk` FOREIGN KEY (`USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE `DOCTOR_SPECIALITIES` (
  `DOCTOR_SPECIALITY_ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `SPECIALITY` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`DOCTOR_SPECIALITY_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE `EXAMS` (
  `EXAM_ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `PATIENT_USER_ID` int(11) unsigned NOT NULL,
  `DOCTOR_USER_ID` int(11) unsigned NOT NULL,
  `VISIT_ID` int(10) unsigned NOT NULL,
  `EXAM_TIME` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `DESC` longtext COLLATE utf8_unicode_ci NOT NULL,
  `LOCATION` longtext COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`EXAM_ID`),
  KEY `patient_fk_idx2` (`PATIENT_USER_ID`),
  KEY `doctor_fk_idx2` (`DOCTOR_USER_ID`),
  CONSTRAINT `doctor_fk2` FOREIGN KEY (`DOCTOR_USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `patient_fk2` FOREIGN KEY (`PATIENT_USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE `LICENSES` (
  `LICENSE_ID` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `STATE` varchar(2) COLLATE utf8_unicode_ci NOT NULL,
  `USER_ID` int(10) unsigned NOT NULL,
  PRIMARY KEY (`LICENSE_ID`,`STATE`),
  KEY `lic_user_fk_idx` (`USER_ID`),
  CONSTRAINT `lic_user_fk` FOREIGN KEY (`USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;;

CREATE TABLE `PRESCRIPTIONS` (
  `PRESCRIPTION_ID` int(10) unsigned NOT NULL,
  `PATIENT_USER_ID` int(10) unsigned NOT NULL,
  `DOCTOR_USER_ID` int(10) unsigned NOT NULL,
  `VISIT_ID` int(10) unsigned NOT NULL,
  `CREATED_TIME` datetime NOT NULL,
  `NAME` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `INSTRUCTIONS` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `REFILLS` int(11) NOT NULL,
  PRIMARY KEY (`PRESCRIPTION_ID`),
  KEY `patient_fk_idx1` (`PATIENT_USER_ID`),
  KEY `doctor_fk_idx1` (`DOCTOR_USER_ID`),
  CONSTRAINT `doctor_fk1` FOREIGN KEY (`DOCTOR_USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `patient_fk1` FOREIGN KEY (`PATIENT_USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE `SESSIONS` (
  `SESSION_ID` varchar(40) COLLATE utf8_unicode_ci NOT NULL,
  `USER_ID` int(10) unsigned NOT NULL,
  `EXP_DT` datetime NOT NULL,
  PRIMARY KEY (`SESSION_ID`),
  KEY `users_fk` (`USER_ID`),
  CONSTRAINT `users_fk` FOREIGN KEY (`USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE `USERS` (
  `USER_ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `CREATED_DT` datetime NOT NULL,
  `ROLE` varchar(45) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'patient',
  `PASSW` text COLLATE utf8_unicode_ci NOT NULL,
  `NAME` text COLLATE utf8_unicode_ci NOT NULL,
  `EMAIL` text COLLATE utf8_unicode_ci NOT NULL,
  `ADDR` text COLLATE utf8_unicode_ci NOT NULL,
  `CITY` text COLLATE utf8_unicode_ci NOT NULL,
  `STATE` text COLLATE utf8_unicode_ci NOT NULL,
  `POSTAL_CODE` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `PHONE` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `PHOTO` longtext COLLATE utf8_unicode_ci NOT NULL,
  `SECRET_Q` text COLLATE utf8_unicode_ci NOT NULL,
  `SECRET_A` text COLLATE utf8_unicode_ci NOT NULL,
  `PHARM_LOC` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `DOB` date NOT NULL,
  `GENDER` varchar(10) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`USER_ID`),
  UNIQUE KEY `USER_ID_UNIQUE` (`USER_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `USERS_DOCTOR_SPECIALITIES` (
  `USERS_DOCTOR_SPECIALITIES_ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `DOCTOR_SPECIALITIES_ID` int(10) unsigned NOT NULL,
  `USER_ID` int(10) unsigned NOT NULL,
  PRIMARY KEY (`USERS_DOCTOR_SPECIALITIES_ID`),
  KEY `users_doc_special_users_fk_idx` (`USER_ID`),
  KEY `users_doc_special_doc_special_fk_idx` (`DOCTOR_SPECIALITIES_ID`),
  CONSTRAINT `users_doc_special_doc_special_fk` FOREIGN KEY (`DOCTOR_SPECIALITIES_ID`) REFERENCES `DOCTOR_SPECIALITIES` (`DOCTOR_SPECIALITY_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `users_doc_special_users_fk` FOREIGN KEY (`USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE `VISITS` (
  `VISIT_ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `PATIENT_USER_ID` int(11) unsigned NOT NULL,
  `DOCTOR_USER_ID` int(11) unsigned NOT NULL,
  `VISIT_REASON` text COLLATE utf8_unicode_ci NOT NULL,
  `VISIT_TIME` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `NOTES` longtext COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`VISIT_ID`),
  KEY `patient_fk_idx` (`PATIENT_USER_ID`),
  KEY `doctor_fk_idx` (`DOCTOR_USER_ID`),
  CONSTRAINT `doctor_fk` FOREIGN KEY (`DOCTOR_USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `patient_fk` FOREIGN KEY (`PATIENT_USER_ID`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE `VISITS_CHAT` (
  `visits_chat_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `visit_id` int(10) unsigned DEFAULT NULL,
  `user_id` int(10) unsigned DEFAULT NULL,
  `msg` longtext COLLATE utf8_unicode_ci,
  `is_read` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`visits_chat_id`),
  KEY `visit_id _idx` (`visit_id`),
  KEY `user_id_fk_idx` (`visit_id`,`user_id`),
  KEY `user_id_fk_idx1` (`user_id`),
  CONSTRAINT `user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `visit_id_fk` FOREIGN KEY (`visit_id`) REFERENCES `USERS` (`USER_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
SELECT * FROM dod.VISITS_CHAT;

CREATE TABLE `QUESTIONNAIRE` (
  `QUESTION_ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `QUESTION` text COLLATE utf8_unicode_ci NOT NULL,
  `PARENT_ID` int(10) unsigned DEFAULT NULL,
  `REASON` text COLLATE utf8_unicode_ci,
  `DOCTOR_SPECIALTY_ID` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`QUESTION_ID`),
  KEY `question_parent_fk_idx` (`PARENT_ID`),
  KEY `question_doctor_special_fk_idx` (`DOCTOR_SPECIALTY_ID`),
  CONSTRAINT `question_doctor_special_fk` FOREIGN KEY (`DOCTOR_SPECIALTY_ID`) REFERENCES `DOCTOR_SPECIALITIES` (`DOCTOR_SPECIALITY_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `question_parent_fk` FOREIGN KEY (`PARENT_ID`) REFERENCES `QUESTIONNAIRE` (`QUESTION_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

